import { useContext, useEffect } from "react";
import { Link } from "react-router-dom";
import ThemeContext from "./ThemeContext";
import "./Ecommerce.css";

function EcommerceHome() {
  const theme = useContext(ThemeContext);

  useEffect(() => {
    const response = fetch(
      "https://api.bestbuy.com/v1/products?apiKey=HqLEjmjgDc84H5tGiiY78uGl&sort=sku.asc&show=sku,image,name,salePrice&pageSize=5&format=json"
    );
    response
      .then((response) => {
        return response.json();
      })
      .then((data) => {
        console.log(data.products[1]);
      });
  }, []);
  return (
    <div className={theme}>
      Hello, welcome to my e-commerce website.
      <br></br>
      <br></br>
      <Link to="/cart">
        <button> Click me to go to a new page.</button>
      </Link>
    </div>
  );
}

export default EcommerceHome;
